import { createApp } from 'vue';
import App from './App.vue';
import router from './router'; // Проверьте путь к вашему маршрутизатору

const app = createApp(App);
app.use(router); // Убедитесь, что здесь используется метод use для маршрутизатора
app.mount('#app');

import axios from 'axios';
import VueAxios from 'vue-axios';

Vue.use(VueAxios, axios);

// Возможно, также у вас есть базовая настройка URL для API
axios.defaults.baseURL = 'http://localhost:3000/api'; // Замените на ваш URL API
